$(document).ready(function(){var e=document.querySelectorAll(".service");console.log(e.length);for(var o=0;o<=e.length;o++){var l=e[o].querySelectorAll("li");if(l.length>5){e[o].innerHTML+='<a class="all-list">Развернуть весь список</a>';for(var t=5;t>=l.lenght;t++);}console.log(e[o])}$(window).scroll(function(){$(this).scrollTop()>100?$(".back-to-top").fadeIn("slow"):$(".back-to-top").fadeOut("slow")}),$('a[href*="#"]:not([href="#"])').click(function(){if(location.pathname.replace(/^\//,"")==this.pathname.replace(/^\//,"")&&location.hostname==this.hostname){var e=$(this.hash);if((e=e.length?e:$("[name="+this.hash.slice(1)+"]")).length)return $("html, body").animate({scrollTop:e.offset().top},1500),!1}})});